script: |
  super -f text -I q4133.spq | sort > q4133.out

inputs:
  - name: q4133.spq
    data: |
      SELECT 6 + 48 * + col2 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT col1 / + col1 + + 34 * col0 + col1 + + col2 NOT BETWEEN col1 AND ( - + col1 + col2 );
  - name: tab2

outputs:
  - name: q4133.out
    data: |
